#!/usr/bin/python3
# https://leetcode.com/problems/find-all-anagrams-in-a-string/
from typing import List, Dict


def isAnagram(string: str, counter: Dict) -> bool:
    for char in string:
        if char not in counter or counter[char] == 0:
            return False
        else:
            counter[char] -= 1
    print(counter)
    return True


def generateHashTable(string: str) -> Dict:
    char_counter = {}
    for char in string:
        if char not in char_counter:
            char_counter[char] = 0
        char_counter[char] += 1
    return char_counter


# Brute Force
def findAnagrams(s: str, p: str) -> List[int]:
    n = len(p)
    counter = generateHashTable(p)
    indices = []
    for i in range(len(s) - n + 1):
        if isAnagram(s[i:i + n], counter.copy()):
            indices.append(i)
    return indices


if __name__ == "__main__":
    testcase = (
        # {
        #     "s": "cbaebabacd",
        #     "p": "abc",
        #     "output": [0, 6]
        # },
        # {
        #     "s": "abab",
        #     "p": "ab",
        #     "output": [0, 1, 2]
        # },
        {
            "s": "",
            "p": "",
            "output": []
        },
    )

    for test in testcase:
        result = findAnagrams(test["s"], test["p"])
        print(result, result == test["output"])
